    false,nt"url": null,nt"notes": "NODC Accession 0104350 includes physical
    and underway data collected aboard the THOMAS G. THOMPSON during cruise TN232 in
    the Philippine Sea from 2009-04-02 to 2009-04-17. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    DEPTH - BOTTOM, DEPTH - OBSERVATION, HYDROSTATIC PRESSURE, SALINITY and WATER TEMPERATURE.
    The instruments used to collect these data include ADCP, CTD, GPS and echo sounder.
    These data were collected by William Chadwick of US DOC; NOAA; OAR; Pacific Marine
    Environmental Laboratory, and by University of Washington as part of Strombolian
    Volcanism, Magma Degassing, and Hydrothermal Discharge at NW Rota-1. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe CTD data submitted by the originator
    represent the raw data suite. Processed versions of the data were generated by NODC.
    The ADCP data represent the raw and automated processed data set. Post processed
    quality assessed data are not available in this accession.",nt"license_title":
